const TableRowItem = (props) => {

    const id = 1;
    const fullName = "Name1";
    const phone = "Phone number1";
    const note = "Note1";

    return (
        <tr>
            <th scope='row'>{id}</th>
            <th>{fullName}</th>
            <th>{phone}</th>
            <th>{note}</th>
        </tr>
    );
}
export default TableRowItem;
